import React from 'react';

const courses = [
  'BBA', 'B.com', 'BBA Honors', 'B.com Honors', 'MBA',
  'B pharm', 'B tech', 'Law', 'Ba-LLB', 'B.com - LLB',
  'BBA - LLB', 'LLB', 'LLM', 'Fashion Designing', 'Interior Designing'
];

export default function CoursesSection() {
  return (
    <section className="section section-medium">
      <div className="container">
        <div className="section-header">
          <h2>Our Popular Courses</h2>
          <p>Explore a wide range of courses to find the perfect one for you.</p>
        </div>
        <div className="course-chips-container">
          {courses.map((course, index) => (
            <div key={index} className="course-chip">
              {course}
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}
